		///<summary>Deletes one EhrLabResult from the database.</summary>
		public static void Delete(long ehrLabResultNum) {
			string command="DELETE FROM ehrlabresult "
				+"WHERE EhrLabResultNum = "+POut.Long(ehrLabResultNum);
			Db.NonQ(command);
		}

		///<summary>Deletes many EhrLabResults from the database.</summary>
		public static void DeleteMany(List<long> listEhrLabResultNums) {
			if(listEhrLabResultNums==null || listEhrLabResultNums.Count==0) {
				return;
			}
			string command="DELETE FROM ehrlabresult "
				+"WHERE EhrLabResultNum IN("+string.Join(",",listEhrLabResultNums.Select(x => POut.Long(x)))+")";
			Db.NonQ(command);
		}

